    GetPetNames() {
        console.log(this.urlBase + "nlp-pet-name/specie/" + this.petSpecie);
        axios
         .post('https://jsonplaceholder.typicode.com/posts')
         .then((response) => {
            this.setState({ posts: response.data });
         })
         .catch((error) => {
            console.log(error);
         });

        fetch(() => {
            axios
                .post(this.urlBase + "nlp-pet-name/specie/" + this.petSpecie)
                .then((res) => {
                    this.setState({ petNames: res.data });
                })
                .catch((err) => {
